import React from 'react';
import './App.css';

function App() {

  function GenerateGrid() {
    let gridPixels = [];
    for (let i = 0; i < 100; i++) {
      gridPixels.append(
        <div id="Pixel"></div>
      );
    };
    return gridPixels;
  };

  return (
    <div className="App">
      <div id="Header">
        <div id="HeaderTitle">
          Algorithms Visualized
        </div>
        <div id="OptionsPanel">
          <div id="Option">Algorithm</div>
          <div id="Option">Speed</div>
          <div id="Option">Grid</div>
          <div id="Option">Algorithm</div>
          <div id="Option">Algorithm</div>
        </div>
      </div>
      <div id="StartPause">Start</div>
      <div id="GridContainer">
        {Pixels}
      </div>
    </div>
  );
}

export default App;
